INSERT INTO `properties_properties` VALUES
	(2, 0, 'LM-26086', 3, 1, 64, 0, 75, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 2, 1, 0, 0, NULL, NULL, 1, 2, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '<p>Torre de la Mata Rosa Beautiful apartment with balcony facing south and also a private sunroof. Nice gardesn and 3 pools in the area. Walkingdistance to the beach Playa de la Mata and all kind of services.</p>', '<p>Torre de la Mata Rosa. Estupenda urbanizacin con jardines y 3 piscinas. La vivienda tiene 2 dormitorios, 1 bao, 1 aseo&nbsp;y&nbsp; solario. Cerca de la Playa de la Mata y todos los dems servicios. Se vende amueblada.</p>', '', '<p>Torre de la Mata Rosa. Bel appartement avec balcon expos sud et galement un toit ouvrant priv. Nice gardesn et 3 piscines dans la rgion. Walkingdistance  la plage Playa de la Mata et toutes sortes de services.</p>', '', 'Torre de la Mata Rosa. Mooi appartement met balkon op het zuiden en een eigen schuifdak. Leuke gardesn en 3 zwembaden in de omgeving. Op loopafstand van het strand Playa de la Mata en alle soorten diensten.', '', '', 'Torre de la Mata Rosa. Vacker lgenhet med balkong mot sder och ven privat soltak. Trevligt gardesn och 3 pooler i omrdet. Gngavstnd till stranden Playa de la Mata och alla slags tjnster.', '', NULL, NULL, NULL, NULL, '<h2>Attic in Rojales: A Refuge of Comfort and Elegance</h2>\r\n<p>Discover this charming <strong>attic in Rojales</strong>, an oasis of tranquility and comfort that combines modern design with an impressive natural environment. With <strong>2 bedrooms</strong> and <strong>1 bathroom</strong>, this <strong>75 m<sup>2</sup></strong> home offers a perfect space to live and enjoy life in Spain. The property includes a <strong>community pool</strong>, ideal for cooling off on sunny days, and a <strong>solarium</strong> that offers panoramic views of the surrounding landscape.</p>\r\n<p>The attic features <strong>pre-installed air conditioning</strong> and <strong>heating</strong>, ensuring comfort all year round. Its modern kitchen is designed to inspire the chef within you, while the outdoor spaces invite you to enjoy the Mediterranean climate. This home is perfect for those seeking a relaxed lifestyle, with all amenities within reach. Don\'t miss the opportunity to live the life you\'ve always dreamed of!</p>\r\n<h2>Rojales: A Paradise on the Costa Blanca</h2>\r\n<p>Located on the beautiful <strong>Costa Blanca</strong>, Rojales is known for its warm climate, natural landscapes, and tranquil atmosphere. This charming town offers an exceptional quality of life, with a perfect blend of tradition and modernity. Just minutes away, you\'ll find supermarkets, schools, and medical centers, as well as a variety of restaurants that delight with local and international cuisine.</p>\r\n<p>Rojales is also a perfect destination for golf enthusiasts, with several courses nearby, and for those who enjoy the beach, with some of the best Mediterranean coasts just a short drive away. Explore the cultural routes or simply relax and enjoy the surroundings. This is the ideal place for those seeking tranquility without sacrificing comfort. Come and discover the charm of Rojales!</p>\r\n<h2>Company Name: Your Ally in Real Estate</h2>\r\n<p>At <strong>Company Name</strong>, we have years of experience in the real estate sector, offering personalized services tailored to your needs. Our professional team is here to guide you every step of the buying process, ensuring a stress-free and satisfactory experience.</p>\r\n<p>Contact us today to discover how we can help you find your dream property in Spain. At <strong>Company Name</strong>, your satisfaction is our priority. We look forward to assisting you soon!</p>', '<h2>tico en Rojales: Un Refugio de Comodidad y Elegancia</h2>\r\n<p>  </p>\r\n<p>Descubre este encantador <strong>tico en Rojales</strong>, un oasis de tranquilidad y confort que combina diseo moderno con un entorno natural impresionante. Con <strong>2 habitaciones</strong> y <strong>1 bao</strong>, este hogar de <strong>75 m<sup>2</sup></strong> ofrece un espacio perfecto para vivir y disfrutar de la vida en Espaa. La propiedad incluye una <strong>piscina comunitaria</strong>, ideal para refrescarse en los das soleados, y un <strong>solrium</strong> que ofrece vistas panormicas del paisaje circundante.</p>\r\n<p>  </p>\r\n<p>El tico cuenta con <strong>pre-instalacin de aire acondicionado</strong> y <strong>calefaccin</strong>, asegurando comodidad durante todo el ao. Su cocina moderna est diseada para inspirar al chef que llevas dentro, mientras que los espacios exteriores invitan a disfrutar del clima mediterrneo. Este hogar es perfecto para aquellos que buscan un estilo de vida relajado, con todas las comodidades a su alcance. No pierdas la oportunidad de vivir la vida que siempre has soado!</p>\r\n<p>  </p>\r\n<h2>Rojales: Un Paraso en la Costa Blanca</h2>\r\n<p>  </p>\r\n<p>Situado en la hermosa <strong>Costa Blanca</strong>, Rojales es conocido por su clima clido, sus paisajes naturales y su atmsfera tranquila. Este encantador municipio ofrece una calidad de vida excepcional, con una mezcla perfecta de tradicin y modernidad. A pocos minutos, encontrars supermercados, colegios y centros mdicos, adems de una variedad de restaurantes que deleitan con la gastronoma local e internacional.</p>\r\n<p>  </p>\r\n<p>Rojales es tambin un destino perfecto para los amantes del golf, con varios campos cercanos, y para quienes disfrutan de la playa, con algunas de las mejores costas del Mediterrneo a solo un corto trayecto en coche. Explora las rutas culturales o simplemente reljate y disfruta del entorno. Este es el lugar ideal para quienes buscan tranquilidad sin renunciar a la comodidad. Ven y descubre el encanto de Rojales!</p>\r\n<p>  </p>\r\n<h2>Nombre Empresa: Tu Aliado en Bienes Races</h2>\r\n<p>  </p>\r\n<p>En <strong>Nombre Empresa</strong>, contamos con aos de experiencia en el sector inmobiliario, of