	(64, 0, 'LEY-96923', 3, 1, 255, 0, 147, 125, 200, NULL, NULL, NULL, NULL, NULL, NULL, 3, 2, 0, 0, NULL, NULL, 1, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '<p>Fantastic 3 bed penthouse in Zeniamar VIII - Playa Flamenca&nbsp;</p>\r\n<p>Leyton Real Estate&nbsp;are happy to announce that this lovely apartment is now for sale in the sought after complex of Zeniamar Phase 8.&nbsp; The property&nbsp;</p>', '<p>Fantstico tico de 3 dormitorios en Zeniamar VIII - Playa Flamenca</p>\r\n<p>Leyton Real Estate se complace en anunciar que este encantador apartamento ya est a la venta en el codiciado complejo de Zeniamar Fase 8.La propiedad consta de 3 dormitorios, 2 baos y una cocina abierta y sala de estar.Desde el saln tiene acceso directo a la terraza orientada al oeste con bonitas vistas al bulevar.En la planta principal se encuentran los dos dormitorios, un bao, la cocina y el saln. Suba las escaleras y encontrar el tercer dormitorio y otro bao. Desde aqu se accede a un amplio y soleado solrium con impresionantes vistas sobre la zona verde del bulevar.</p>\r\n<p>La vivienda se vende completamente amueblada e incluye parking subterrneo y trastero.</p>\r\n<p>Zeniamar es una gran zona comunitaria con jardines muy cuidados y una gran piscina. La residencia est en una ubicacin muy cntrica, con restaurantes y tiendas. Ests cerca del centro comercial Zenia Boulevard, repleto de emocionantes tiendas y deliciosos restaurantes, ya solo 800 metros de las playas de Playa Flamenca. Si te gusta el golf o simplemente te gusta la naturaleza te alegrar saber que en el rea de diez kilmetros se ubican nada menos que cuatro campos de golf de 18 hoyos.</p>', '', NULL, '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 216000, 0, 0, 0, 1, 0, 0, 0, 0, 0, NULL, NULL, NULL, '37.945887,-0.726299', NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NUL