INSERT INTO `templates` VALUES
	(1, 'Initial response without telephone', 'Respuesta Inicial sin telfono', NULL, 'Resposta inicial sense telfon', 'Frste svar uden telefon', 'Erste Reaktion ohne Telefon', 'Initial response without telephone', 'Respuesta Inicial sin telfono', 'Ensimminen vastaus ilman puhelinta', 'Rponse initiale sans tlphone', 'Fyrsta svar n sma', 'Eerste reactie zonder telefoon', 'Innledende svar uten telefon', '   ', 'Frsta svar utan telefon', '', 'Wstpna reakcja bez telefonu', 'Grcies per contactar amb la nostra agncia immobiliria.\r\nAqu tens la informaci que has sollicitat sobre la segent propietat.\r\nPodeu fer clic per a ms informaci i cases similars:\r\n\r\n{{PROPERTY}}\r\n\r\nSi voleu que un dels nostres assessors es posin en contacte amb vosaltres, responeu a aquest correu electrnic indicant un nmero de telfon i una hora en qu us conv rebre una trucada o un whatsapp.\r\n\r\nSalutacions cordials i grcies pel vostre temps', 'Tak for din henvendelse til vores ejendomsmglerfirma.\r\nHer har du de oplysninger, du har anmodet om om flgende ejendom.\r\nDu kan klikke for mere information og lignende huse:\r\n\r\n{{PROPERTY}}\r\n\r\nHvis du nsker, at en af vores rdgivere kontakter dig, bedes du svare p denne e-mail og angive et telefonnummer og et tidspunkt, hvor det ville vre praktisk for dig atmodtage et opkald eller whatsapp.\r\n\r\nMed venlig hilsen og tak for din tid', 'Vielen Dank, dass Sie unser Immobilienbro kontaktiert haben.\r\nHier finden Sie die von Ihnen gewnschten Informationen zu folgender Immobilie.\r\nFr weitere Informationen und hnliche Huser knnen Sie hier klicken:\r\n\r\n{{PROPERTY}}\r\n\r\nWenn Sie mchten, dass sich einer unserer Berater mit Ihnen in Verbindung setzt, antworten Sie bitte auf diese E-Mail und geben Sie eine Telefonnummer und einenZeitpunkt an, zu dem Sie einen Anruf oder eine Whatsapp-Nachricht erhalten mchten.\r\n\r\nMit freundlichen Gren und vielen Dank fr Ihre Zeit', 'Thank you for contacting our real estate agency.\r\nHere you have the information you have requested about the following property.\r\nYou can click for more information and similar houses:\r\n\r\n{{PROPERTY}}\r\n\r\nIf you would like one of our advisors to contact you, please reply to this email, indicating a telephone number and a time when it would be convenient for you toreceive a call or whatsapp.\r\n\r\nBest regards and thank you for your time', 'Gracias por contactar con nuestra inmobiliaria.\r\nAqu tienes la informacin que nos has solicitado sobre la siguiente propiedad.\r\nPuedes hacer clic para ms informacin y casas similares:\r\n\r\n{{PROPERTY}}\r\n\r\nSi quiere que uno de nuestros asesores se ponga en contacto contigo, por favor responde a este mail, indicando un nmero de telfono y una hora a la que te viene bienrecibir una llamada o whatsapp.\r\n\r\nUn saludo y gracias por tu tiempo', 'Kiitos, ett otit yhteytt kiinteistvlitystoimistoomme.\r\nTss on pyytmsi tiedot seuraavasta kiinteistst.\r\nVoit klikata listietoja ja samankaltaisia taloja:\r\n\r\n{{PROPERTY}}\r\n\r\nJos haluat, ett joku neuvonantajistamme ottaa sinuun yhteytt, vastaa thn shkpostiin ja ilmoita puhelinnumero ja aika, jolloin sinulle sopisi soittaa tai whatsappata.\r\n\r\nYstvllisin terveisin ja kiitos ajastanne', 'Merci d\'avoir contact notre agence immobilire.\r\nVous trouverez ici les informations que vous avez demandes concernant le bien suivant.\r\nVous pouvez cliquer pour obtenir plus d\'informations et des maisons similaires :\r\n\r\n{{PROPERTY}}\r\n\r\nSi vous souhaitez que l\'un de nos conseillers vous contacte, veuillez rpondre  cet e-mail en indiquant un numro de tlphone et une heure  laquelle il vousconviendrait de recevoir un appel ou un whatsapp.\r\n\r\nMeilleures salutations et merci pour votre temps', 'akka r fyrir a hafa samband vi fasteignasluna okkar.\r\nHr hefur  upplsingarnar sem  hefur bei um um eftirfarandi eign.\r\n getur smellt fyrir frekari upplsingar og svipu hs:\r\n\r\n{{PROPERTY}}\r\n\r\nEf  vilt a einn af rgjfunum okkar hafi samband vi ig, vinsamlegast svarau essum tlvupsti og tilgreinir smanmer og hvenr hentar r a f smtal ea whatsapp.\r\n\r\nBestu kvejur og takk fyrir tmann', 'Dank u voor het contacteren van ons makelaarskantoor.\r\nHier is de informatie die u heeft opgevraagd over het volgende object.\r\nU kunt klikken voor meer informatie en soortgelijke huizen:\r\n\r\n{{PROPERTY}}\r\n\r\nIndien u wenst dat een van onze adviseurs contact met u opneemt, gelieve dan te antwoorden op deze e-mail, met vermelding van een telefoonnummer en een tijdstip waarophet u schikt om een telefoontje of een whatsapp te ontvangen.\r\n\r\nMet vriendelijke groet en dank u voor uw tijd', 'Takk for at du kontakter vr eiendom.\r\nHer er informasjonen du har bedt om om flgende eiendom.\r\nDu kan klikke for mer informasjon og lignende hus:\r\n\r\n{{PROPERTY}}\r\n\r\nHvis du vil at en av vre rdgivere skal kontakte deg, vennligst svar p denne e-posten, og oppgi et telefonnummer og et tidspunkt det passer for deg  motta en samtaleeller whatsapp.\r\n\r\nHilsen og takk for din tid', '       .\r\n        .\r\n         :\r\n\r\n{{PROPERTY}}\r\n\r\n  ,        , ,    ,     ,        Whatsapp.\r\n\r\n       ', 'Tack fr att du har kontaktat vr fastighetsbyr.\r\nHr r den information som du har begrt om fljande fastighet.\r\nDu kan klicka fr mer information och liknande hus:\r\n\r\n{{PROPERTY}}\r\n\r\nOm du vill att en av vra rdgivare ska kontakta dig, vnligen svara p detta e-postmeddelande och ange ett telefonnummer och en tid d det skulle passa dig att f ettsamtal eller en whatsapp.\r\n\r\nMed vnliga hlsningar och tack fr att du tog dig tid.', '\r\n\r\n\r\n\r\n{{PROPERTY}}\r\n\r\nWhatsapp\r\n\r\n', 'Dzikujemy za kontakt z nasz agencj nieruchomoci.\r\nTutaj znajdziesz informacje, o ktre prosie, dotyczce nastpujcej nieruchomoci.\r\nKliknij, aby uzyska wicej informacji i zobaczy podobne domy:\r\n\r\n{{PROPERTY}}\r\n\r\nJeli chcesz, aby jeden z naszych doradcw skontaktowa si z Tob, odpowiedz na t wiadomo, podajc numer telefonu i czas, w ktrym byby w stanie odebra telefonlub wiadomo SMS.\r\n\r\nPozdrawiam serdecznie i dzikuj za powicony czas', 0),
