nBestu kvejur og takk fyrir tmann', 'Dank u voor het contacteren van ons makelaarskantoor.\r\nHier heeft u de informatie die u heeft opgevraagd over het volgende object.\r\nU kunt klikken voor meer informatie en soortgelijke huizen:\r\n\r\n{{PROPERTY}}\r\n\r\nIndien u wenst dat een van onze adviseurs contact met u opneemt, gelieve deze e-mail te beantwoorden en een tijdstip op te geven dat u schikt om een telefoontje ofwhatsapp te ontvangen.\r\n\r\nMet vriendelijke groet en dank u voor uw tijd', 'Takk for at du kontakter vr eiendom.\r\nHer er informasjonen du har bedt om om flgende eiendom.\r\nDu kan klikke for mer informasjon og lignende hus:\r\n\r\n{{PROPERTY}}\r\n\r\nHvis du vil at en av vre rdgivere skal kontakte deg, vennligst svar p denne e-posten og angi et tidspunkt det passer for deg  motta en samtale eller whatsapp.\r\n\r\nHilsen og takk for din tid', '       .\r\n        .\r\n         :\r\n\r\n{{PROPERTY}}\r\n\r\n  ,        , ,    ,  ,        Whatsapp.\r\n\r\n       ', 'Tack fr att du har kontaktat vr fastighetsbyr.\r\nHr har du den information som du har begrt om fljande fastighet.\r\nDu kan klicka fr mer information och liknande hus:\r\n\r\n{{PROPERTY}}\r\n\r\nOm du vill att en av vra rdgivare ska kontakta dig, vnligen svara p detta e-postmeddelande och ange en tidpunkt nr det skulle passa dig att f ett samtal eller enwhatsapp.\r\n\r\nMed vnliga hlsningar och tack fr att du tog dig tid.', '\r\n\r\n\r\n\r\n{{PROPERTY}}\r\n\r\nWhatsapp\r\n\r\n', 'Dzikujemy za kontakt z nasz agencj nieruchomoci.\r\nTutaj znajdziesz informacje, o ktre prosie, dotyczce nastpujcej nieruchomoci.\r\nKliknij, aby uzyska wicej informacji i zobaczy podobne domy:\r\n\r\n{{PROPERTY}}\r\n\r\nJeli chcesz, aby jeden z naszych doradcw skontaktowa si z Tob, odpowiedz na t wiadomo, podajc czas, w ktrym byby zainteresowany otrzymaniem telefonu lubwiadomoci SMS.\r\n\r\nPozdrawiam serdecznie i dzikuj za powicony czas', 0),
	(4, 'Visit confirmation', 'Confirmacin visita', NULL, 'Confirmaci de visita', 'Bekrftelse af besg', 'Besttigung des Besuchs', 'Confirmation of visit', 'Confirmacin visita', 'Vahvistus vierailusta', 'Confirmation de la visite', 'Stafesting  heimskn', 'Bevestiging van het bezoek', 'Konfirmasjonsbesk', ' ', 'Bekrftelse av besket', '', 'Potwierdzenie wizyty', 'Hola ...........................\r\nAquesta s la confirmaci de la cita per visitar la propietat:\r\nData: ......................\r\nTemps: ......................\r\nPunt de trobada: ......................\r\nPropietats per visualitzar:\r\n\r\n{{PROPERTY}} \r\n\r\nConfirmeu-me si les dades sn correctes:\r\n......................\r\n\r\nSalutacions cordials i grcies pel vostre temps', 'Hej ...........................\r\nDette er bekrftelsen p aftalen om besigtigelse af ejendommen:\r\nDato: ......................\r\nTid: ......................\r\nMdested: ......................\r\nEjendomme, der skal besigtiges: \r\n\r\n{{PROPERTY}} \r\n\r\nBekrft mig, hvis dataene er korrekte:\r\n......................\r\n\r\nMed venlig hilsen og tak for din tid', '<p>Hallo ...........................</p>\r\n<p>Dies ist die Besttigung des Termins zur Besichtigung der Immobilie:</p>\r\n<p>Datum: ......................</p>\r\n<p>Zeit: ......................</p>\r\n<p>Treffpunkt: ......................</p>\r\n<p>Eigenschaften zur Ansicht: </p>\r\n<p>{{PROPERTY}}</p>\r\n<p>Besttigen Sie mir, ob die Daten korrekt sind:</p>\r\n<p>......................</p>\r\n<p>Mit freundlichen Gren und vielen Dank fr Ihre Zeit</p>', '<p>Hi {CLIENT},<br></p>\r\n<p></p>\r\n<p>This is to confirm your upcoming visit to the following property:</p>\r\n<p></p>\r\n<p>&nbsp;<strong>Address:</strong>&nbsp;[Property address]</p>\r\n<p>&nbsp;<strong>Date:</strong>&nbsp;[Day, dd/mm/yyyy]</p>\r\n<p>&nbsp;<strong>Time:</strong>&nbsp;[Appointment time]</p>\r\n<p></p>\r\n<p>Well be waiting for you at the location. If you need directions, want to reschedule, or have any