lfen und Sie beraten, um den bestmglichenPreis zu erzielen und Ihre Fragen zum Verkaufsprozess zu beantworten. \r\n\r\nMit freundlichen Gren und vielen Dank fr Ihre Zeit', 'Hello ......................\r\n\r\nThis is a confirmation to meet your property and make the necessary data collection to register your property in our system and put it for sale: \r\n\r\nDate: ......................\r\nTime: ......................\r\nContact person: ......................\r\n\r\nThe person who will visit your property has a lot of experience and knowledge of the property market and will be able to help and advise you to achieve the bestpossible price and answer your questions about the selling process. \r\n\r\nBest regards and thank you for your time', 'Hola .\r\n\r\nEsta es una confirmacin para quedar en su propiedad y realizar la toma de datos necesaria para dar de alta su propiedad en nuestro sistema y ponerla en venta: \r\n\r\nFecha: .\r\nHora: .\r\nPersona de contacto: .\r\n\r\nLa persona que visitar su propiedad tiene mucha experiencia y conocimiento del mercado inmobiliario y podr ayudarlo y asesorarlo para lograr el mejor precio posible y responder a sus preguntas sobre proceso de venta. \r\n\r\nUn saludo  y gracias por tu tiempo', 'Hei ......................\r\n\r\nTm on vahvistus tapaamaan omaisuuttasi ja suorittamaan tarvittava tiedonkeruu, jotta omaisuutesi voidaan rekisterid jrjestelmmme ja laittaa se myyntiin: \r\n\r\nPivys: ......................\r\nAika: ......................\r\nYhteyshenkil: ......................\r\n\r\nHenkilll, joka ky kiinteistsi luona, on paljon kokemusta ja tietoa kiinteistmarkkinoista, ja hn pystyy auttamaan ja neuvomaan sinua parhaan mahdollisen hinnan saamiseksi ja vastaamaan myyntiprosessia koskeviin kysymyksiisi. \r\n\r\nYstvllisin terveisin ja kiitos ajastanne', 'Bonjour ......................\r\n\r\nIl s\'agit d\'une confirmation pour rencontrer votre proprit et effectuer la collecte des donnes ncessaires pour enregistrer votre pr