of heeft u liever dat wij andere woningen bezichtigen?</p>\r\n<p>Met vriendelijke groet en dank u voor uw tijd</p>', '<p>Hallo  .</p>\r\n<p>Jeg hper du vil like eiendommene vi nylig beskte.</p>\r\n<p>{{PROPERTY}}</p>\r\n<p>Jeg sender deg denne meldingen for  se om du trenger mer informasjon eller om du nsker  beske huset igjen.</p>\r\n<p>nsker du at vi skal gi et tilbud til selger eller foretrekker du at vi besker andre boliger?</p>\r\n<p>Hilsen og takk for din tid</p>', ' ......................\r\n\r\n,   ,    . \r\n\r\n{{PROPERTY}} \r\n\r\n    ,  ,             .\r\n\r\n  ,     ,   ,     ?\r\n\r\n       ', '<p>Hej ......................</p>\r\n<p>Jag hoppas att du gillar de fastigheter som vi beskte nyligen. </p>\r\n<p>{{PROPERTY}} </p>\r\n<p>Jag skickar det hr meddelandet fr att hra om du behver mer information eller om du vill beska huset igen.</p>\r\n<p>Vill du att vi ska lgga ett bud p sljaren eller fredrar du att vi besker andra fastigheter?</p>\r\n<p>Med vnliga hlsningar och tack fr att du tog dig tid.</p>', ' ......................\r\n\r\n\r\n\r\n{{PROPERTY}} \r\n\r\n\r\n\r\n\r\n\r\n', '<p>Witaj ......................</p>\r\n<p>Mam nadziej, e spodobaj si Wam nieruchomoci, ktre ostatnio odwiedzilimy. </p>\r\n<p>{{PROPERTY}} </p>\r\n<p>Wysyam t wiadomo, aby dowiedzie si, czy potrzebujecie Pastwo dalszych informacji lub czy chcielibycie ponownie odwiedzi dom.</p>\r\n<p>Czy chcesz, abymy zoyli ofert sprzedajcemu, czy wolisz, abymy odwiedzili inne nieruchomoci?</p>\r\n<p>Pozdrawiam serdecznie i dzikuj za powicony czas</p>', 0),
	(7, 'No reply', 'No responde', NULL, 'Sense resposta', 'Ingen svar', 'Keine Antwort', 'No reply', 'No responde', 'Ei vastausta', 'Pas de rponse', 'Ekkert svar', 'Geen antwoord', 'Svarer ikke', ' ', 'Inget svar', '', 'Brak odpowiedzi', 'Hola,\r\n\r\nHem rebut la vostra sollicitud d\'informaci sobre aquesta propietat:\r\n\r\n{{PROPERTY}}\r\n\r\nHem intentat contactar amb tu diverses vegades i no ha estat possible.\r\n\r\nSi encara esteu interessats, aviseu-me quan voleu que ens tornem a contactar amb vosaltres.\r\nSi necessiteu ms informaci, poseu-vos en contacte amb nosaltres.\r\n\r\nSalutacions cordials i grcies pel vostre temps', 'Hej,\r\n\r\nVi har modtaget din anmodning om oplysninger om denne ejendom:\r\n\r\n{{PROPERTY}}\r\n\r\nVi har forsgt at kontakte dig flere gange, men det har ikke vret muligt.\r\n\r\nHvis du stadig er interesseret, s lad mig venligst vide, hvornr du nsker, at vi skal kontakte dig igen.\r\nHvis du har brug for yderligere oplysninger, bedes du kontakte os.\r\n\r\nMed venlig hilsen og tak for din tid', 'Hallo \r\n\r\nWir haben Ihre Anfrage nach Informationen ber diese Immobilie erhalten:\r\n\r\n{{PROPERTY}}\r\n\r\nWir haben mehrmals versucht, Sie zu kontaktieren, aber es war nicht mglich.\r\n\r\nWenn Sie immer noch interessiert sind, lassen Sie mich bitte wissen, wann wir Sie wieder kontaktieren sollen.\r\nWenn Sie weitere Informationen bentigen, wenden Sie sich bitte an uns.\r\n\r\nMit freundlichen Gren und vielen Dank fr Ihre Zeit', 'Hello,\r\n\r\nWe have received your request for information about this property:\r\n\r\n{{PROPERTY}}\r\n\r\nWe have tried to contact you several times and it has not been possible.\r\n\r\nIf you are still interested, please let me know when you would like us to contact you again.\r\nIf you need any further information, please contact us.\r\n\r\nBest regards and thank you for your time', 'Hola \r\n\r\nTras haber recibido tu solicitud de informacin sobre esta propiedad:\r\n\r\n{{PROPERTY}}\r\n\r\nHemos intentado