endommen:\r\n\r\n{{PROPERTY}}\r\n\r\nVi har forskt  kontakte deg ved forskjellige anledninger og det har ikke vrt mulig.\r\n\r\nHvis du fortsatt er interessert, fortell meg nr du vil at vi skal kontakte deg igjen\r\nHvis du trenger ytterligere informasjon, vennligst kontakt oss\r\n\r\nHilsen og takk for din tid', ',\r\n\r\n        :\r\n\r\n{{PROPERTY}}\r\n\r\n      ,    .\r\n\r\n    , , ,   ,      .\r\n   -  , ,   .\r\n\r\n       ', 'Hej \r\n\r\nVi har mottagit din begran om information om denna fastighet:\r\n\r\n{{PROPERTY}}\r\n\r\nVi har frskt kontakta dig flera gnger men det har inte varit mjligt.\r\n\r\nOm du fortfarande r intresserad, lt mig veta nr du vill att vi kontaktar dig igen.\r\nOm du behver mer information kan du kontakta oss.\r\n\r\nMed vnliga hlsningar och tack fr att du tog dig tid.', '\r\n\r\n\r\n\r\n{{PROPERTY}}\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'Witaj \r\n\r\nOtrzymalimy Twoj prob o informacje na temat tego obiektu:\r\n\r\n{{PROPERTY}}\r\n\r\nKilkakrotnie prbowalimy si z Tob skontaktowa, ale nie byo to moliwe.\r\n\r\nJeli nadal jeste zainteresowany, daj mi zna, kiedy chciaby, abymy skontaktowali si z Tob ponownie.\r\nJeli potrzebujesz dodatkowych informacji, skontaktuj si z nami.\r\n\r\nPozdrawiam serdecznie i dzikuj za powicony czas', 0);
